import React, { useState, useEffect } from 'react';

const OwnerDetails = () => {
  const [owners, setOwners] = useState([]);
  const [selectedOwner, setSelectedOwner] = useState(null);

  useEffect(() => {
    // Fetch owner and book data from an API or database
    const ownerData = [
      {
        id: 1,
        name: 'Nardos T',
        email: 'nardos@example.com',
        location: 'Addis Ababa',
        books: [
          { id: 1, title: 'Book 1', price: 40, status: 'Active' },
          { id: 2, title: 'Book 2', price: 30, status: 'Inactive' },
          { id: 3, title: 'Book 3', price: 50, status: 'Active' },
        ],
      },
      // Add more owner data here
    ];
    setOwners(ownerData);
  }, []);

  const handleOwnerSelect = (ownerId) => {
    const selectedOwner = owners.find((owner) => owner.id === ownerId);
    setSelectedOwner(selectedOwner);
  };

  const handleApprove = (bookId) => {
    // Implement logic to approve the book
    console.log(`Approving book with ID: ${bookId}`);
  };

  return (
    <div
      style={{
        display: 'flex',
        height: '100vh',
      }}
    >
      <div
        style={{
          backgroundColor: '#1e2a3a',
          color: '#fff',
          padding: '20px',
          width: '200px',
        }}
      >
        {/* Sidebar content */}
      </div>
      <div
        style={{
          flex: 1,
          padding: '20px',
        }}
      >
        <div
          style={{
            fontSize: '24px',
            fontWeight: 'bold',
            marginBottom: '20px',
          }}
        >
          Owners
        </div>
        <div
          style={{
            display: 'flex',
            flexWrap: 'wrap',
            marginBottom: '20px',
          }}
        >
          {owners.map((owner) => (
            <div
              key={owner.id}
              style={{
                backgroundColor: '#f1f1f1',
                padding: '10px 20px',
                borderRadius: '4px',
                margin: '0 10px 10px 0',
                cursor: 'pointer',
                ...(selectedOwner?.id === owner.id && {
                  backgroundColor: '#007bff',
                  color: '#fff',
                }),
              }}
              onClick={() => handleOwnerSelect(owner.id)}
            >
              {owner.name}
            </div>
          ))}
        </div>
        {selectedOwner && (
          <div
            style={{
              backgroundColor: '#f1f1f1',
              padding: '20px',
              borderRadius: '4px',
            }}
          >
            <div
              style={{
                display: 'flex',
                flexDirection: 'column',
                marginBottom: '20px',
              }}
            >
              <div
                style={{
                  fontSize: '18px',
                  fontWeight: 'bold',
                }}
              >
                {selectedOwner.name}
              </div>
              <div
                style={{
                  fontSize: '14px',
                  color: '#666',
                }}
              >
                {selectedOwner.email}
              </div>
              <div
                style={{
                  fontSize: '14px',
                  color: '#666',
                }}
              >
                {selectedOwner.location}
              </div>
            </div>
            <div
              style={{
                fontSize: '16px',
                fontWeight: 'bold',
                marginBottom: '10px',
              }}
            >
              Books
            </div>
            <table
              style={{
                width: '100%',
                borderCollapse: 'collapse',
              }}
            >
              <thead>
                <tr>
                  <th
                    style={{
                      backgroundColor: '#f1f1f1',
                      padding: '10px',
                      textAlign: 'left',
                    }}
                  >
                    No.
                  </th>
                  <th
                    style={{
                      backgroundColor: '#f1f1f1',
                      padding: '10px',
                      textAlign: 'left',
                    }}
                  >
                    Title
                  </th>
                  <th
                    style={{
                      backgroundColor: '#f1f1f1',
                      padding: '10px',
                      textAlign: 'left',
                    }}
                  >
                    Price
                  </th>
                  <th
                    style={{
                      backgroundColor: '#f1f1f1',
                      padding: '10px',
                      textAlign: 'left',
                    }}
                  >
                    Status
                  </th>
                  <th
                    style={{
                      backgroundColor: '#f1f1f1',
                      padding: '10px',
                      textAlign: 'left',
                    }}
                  >
                    Action
                  </th>
                </tr>
              </thead>
              <tbody>
                {selectedOwner.books.map((book, index) => (
                  <tr
                    key={book.id}
                    style={{
                      borderBottom: '1px solid #ddd',
                    }}
                  >
                    <td
                      style={{
                        padding: '10px',
                      }}
                    >
                      {index + 1}
                    </td>
                    <td
                      style={{
                        padding: '10px',
                      }}
                    >
                      {book.title}
                    </td>
                    <td
                      style={{
                        padding: '10px',
                      }}
                    >
                      ETB {book.price}
                    </td>
                    <td
                      style={{
                        padding: '10px',
                      }}
                    >
                      <div
                        style={{
                          width: '10px',
                          height: '10px',
                          borderRadius: '50%',
                          marginRight: '5px',
                          ...(book.status === 'Active'
                            ? {
                                backgroundColor: 'green',
                              }
                            : {
                                backgroundColor: 'red',
                              }),
                        }}
                      />
                      {book.status}
                    </td>
                    <td
                      style={{
                        padding: '10px',
                      }}
                    >
                      <button
                        style={{
                          backgroundColor: '#007bff',
                          color: '#fff',
                          border: 'none',
                          padding: '5px 10px',
                          borderRadius: '4px',
                          cursor: 'pointer',
                        }}
                        onClick={() => handleApprove(book.id)}
                      >
                        Approve
                      </button>
                    </td>
                  </tr>
                ))}
              </tbody>
            </table>
          </div>
        )}
      </div>
    </div>
  );
};

export default OwnerDetails;
